import React from "react";

function QnAQuestionsAnalysis() {
  return (
    <div>
      <div
        style={{
          height: "15vh",
          width: "100%",
          backgroundColor: "black",
          display: "flex",
        }}
      >
        <div>
          <p
            style={{
              color: "white",
              fontSize: "1.8em",
              fontWeight: "600",
              paddingTop: "4.5vh",
              paddingLeft: "5vw",
            }}
          >
            Quiz 2 Question Analysis
          </p>
        </div>
        <div>
          <p
            style={{
              color: "white",
              fontSize: "1.3em",
              fontWeight: "600",
              paddingTop: "3.5vh",
              paddingLeft: "5vw",
            }}
          >
            Created on : 04 Sep, 2023
          </p>
          <p
            style={{
              color: "white",
              fontSize: "1.3em",
              fontWeight: "600",
              paddingTop: "1vh",
              paddingLeft: "5vw",
            }}
          >
            Impressions : 667
          </p>
        </div>
      </div>
    </div>
  );
}

export default QnAQuestionsAnalysis;
